import React from "react";

export default function Footer() {
    return(
        <footer className="tm-black-bg">
		<div className="container">
			<div className="row">
				<p className="tm-copyright-text">Copyright &copy; 2084 Your Company Name</p>
			</div>
		</div>		
	</footer>
    )
}
